import React from "react";
import "./Item.css";
import { Button } from "@mui/material";

const Item = (props) => {
  return (
    <div className="item-div">
      <h3 className="item-h3">Hello</h3>
      <Button variant="contained" color="success">
        Done
      </Button>
      <Button variant="outlined" color="danger">
        Delete
      </Button>
    </div>
  );
};

export default Item;
